  return (
    <>
      <div className="fondo">
          <div sm={4}>
            1
          </div>
          <div sm={4}>
            2
          </div>
          <div sm={4}>
            3
          </div>
          <div sm={4}>
            4
          </div>
      </div>
    </>
  );
}

export default Main;
